import React from 'react';
import {RouteComponentProps} from 'react-router';

/*import {
    GoogleMap,
    useLoadScript,
    Marker,
    InfoWindow,
} from "@react-google-maps/api";*/

type WalkConfirmedProps = {
    success?: string | undefined
}

function WalkConfirmedScreen({location}: RouteComponentProps<WalkConfirmedProps>) {

    const props = location.state as WalkConfirmedProps;

    return (
        <div>
            <br/>
            <div>
                {
                    /*!!props && !!props.success ?*/
                    <div className="horizontal-center">Šetnja je potvrđena, sada ju možete vidjeti u svom rasporedu.
                        <iframe
                            width="600"
                            height="450"
                            frameBorder="0"
                            src="https://www.google.com/maps/embed/v1/place?key=AIzaSyCIIskDofJHbJtt5-dBh7_p2s1HExY93BA
                                &q=STrgPavlaŠtoosa39,Varaždin"
                            allowFullScreen>
                        </iframe>

                    </div>
                    /* :
                     <div className="horizontal-center">Dogodila se greška, pokušajte ponovno prijaviti šetnju!</div>*/
                }
            </div>

        </div>
    );
}

export default WalkConfirmedScreen;
